import {
  MDBBtn,
  MDBNavbarLink
} from 'mdb-react-ui-kit';
import Header from '../../components/header/header';
import { animateScroll as scroll } from 'react-scroll';

const Home = () => {
    function ScrollLink({ to, label }) {
        const scrollToSection = () => {
          scroll.scrollTo(to, {
            duration: 500,
            smooth: true,
            offset: -100, // Adjust the offset as needed
          });
        };
    }

