        <div style={{marginTop:50}}>
            <h1>More about our business</h1>
        </div>

        <div style={{marginTop:400, marginLeft:500, marginRight:50}}>
        <img src="/images/callaLilly.jpeg" alt="image1" style={{width: "100%"}}></img>
        </div>

        <div style={{marginTop:150, margin: 50}}>
